    false,nt"url": null,nt"notes": "This annual narrative report details the
    conditions and management of San Francisco Bay National Wildlife Refuge in 1984.
     The report begins with highlights from the year, climatic conditions, and land
    acquisition.  The following section is about planning and includes information about
    the refuge master plan, management plan, public participation, environmental compliance,
    and research/investigation.  Administration is covered next including personnel,
    youth programs, man power, volunteer programs, funding, safety, and technical assistance.
     The sixth section of the report discusses habitat management.  Habitats include
    wetlands, forests, croplands, and grasslands.  Wildlife is described in the following
    section with special detail given to threatened/endangered species, waterfowl, marsh
    birds, shorebirds, raptors, other migratory birds, game mammals, marine mammals,
    and fish.  Public use of the refuge is discussed next.  Topics include education,
    foot trails, interpretive programs, hunting, fishing, trapping, wildlife oriented
    recreation, camping, picnicking, law enforcement, and concessions.  Finally, refuge
    equipment and facilities are described.",nt"license_title": "License Not Specified",nt"extras":
